INSERT INTO `testimonials` VALUES ('1', 'Phụ huynh bé Ngọc Linh - 5 tuổi', 'phu-huynh-be-ngoc-linh-5-tuoi', 'Phụ huynh bé Ngọc Linh - 5 tuổi', '<p>\r\n	&quot;B&eacute; đ&atilde; được tham gia kh&oacute;a học h&egrave; ILA năm 2015. M&ocirc;i trường th&acirc;n thiện, 100% gi&aacute;o vi&ecirc;n bản ngữ, phương ph&aacute;p giảng dạy kết hợp nhiều tr&ograve; chơi rất hấp dẫn, n&ecirc;n b&eacute; học tiếng Anh nhẹ nh&agrave;ng, kh&ocirc;ng cần g&ograve; &eacute;p... Điều khiến vợ chồng t&ocirc;i bất ngờ v&agrave; tự h&agrave;o l&agrave; kiến thức về kỹ năng b&agrave;n tiệc trong kh&oacute;a học được b&eacute; &aacute;p dụng khi cả nh&agrave; đi ăn tiệc.&quot;</p>\r\n', 'http://ila.edu.vn/anh-van-he/public/upload/testimonial/1491884313_ngoclinh.jpg', null, '1', '1', '2017-03-31 11:15:12', '2017-04-11 04:18:33');
INSERT INTO `testimonials` VALUES ('2', 'Phụ huynh bé Thanh Khang (8 tuổi) và Thanh Khôi (4 tuổi)', 'phu-huynh-be-thanh-khang-8-tuoi-va-thanh-khoi-4-tuoi-', 'Phụ huynh bé Thanh Khang (8 tuổi) và Thanh Khôi (4 tuổi)', '<p>\r\n	&ldquo;T&ocirc;i th&iacute;ch c&aacute;ch HỌC M&Agrave; CHƠI của c&aacute;c kh&oacute;a học h&egrave; tại ILA. Hai &ldquo;nh&oacute;c con&rdquo; nh&agrave; t&ocirc;i kh&aacute; nghịch ngợm v&agrave; năng động. Kh&oacute;a h&egrave; vừa rồi, ch&uacute;ng kh&ocirc;ng bỏ qua một hoạt động ngoại kh&oacute;a n&agrave;o v&agrave; th&iacute;ch nhất m&ocirc;n b&oacute;ng rổ với Saigon Heat... &rdquo;.</p>\r\n', 'http://ila.edu.vn/anh-van-he/public/upload/testimonial/1491884304_thanhkhang.jpg', null, '2', '1', '2017-03-31 11:15:56', '2017-04-11 04:18:24');
INSERT INTO `testimonials` VALUES ('3', 'Phụ huynh bé Gia Hân (13 tuổi)', 'phu-huynh-be-gia-han-13-tuoi-', 'Phụ huynh bé Gia Hân (13 tuổi)', '<p>\r\n	&ldquo;Ngo&agrave;i việc trang bị vốn tiếng Anh vững v&agrave;ng t&ocirc;i c&ograve;n rất quan t&acirc;m đến việc ph&aacute;t triển kỹ năng mềm cho con. Chương tr&igrave;nh h&egrave; năm nay ILA c&oacute; lớp Đầu bếp nh&iacute; cho b&eacute; t&igrave;m hiểu về ẩm thực v&agrave; được tự tay nấu ăn. Ngo&agrave;i ra lớp hướng dẫn Kỹ năng sinh tồn gi&uacute;p b&eacute; nhận biết v&agrave; ph&ograve;ng tr&aacute;nh nguy hiểm trong c&aacute;c t&igrave;nh huống thường gặp...&rdquo;</p>\r\n', 'http://ila.edu.vn/anh-van-he/public/upload/testimonial/1491884297_gia-han.jpg', null, '3', '1', '2017-03-31 11:16:16', '2017-04-11 04:18:17');
INSERT INTO `testimonials` VALUES ('4', 'Phụ huynh bé Bùi Mạnh Hoàng – Bậc Super Juniors', 'phu-huynh-be-bu-i-ma-nh-hoa-ng-ba-c-super-juniors', 'Phụ huynh bé Bùi Mạnh Hoàng – Bậc Super Juniors', '<p>\r\n	&ldquo;Năm vừa rồi, Ho&agrave;ng tham gia kh&oacute;a h&egrave; tại ILA v&agrave; khả năng giao tiếp tiếng Anh của b&eacute; tiến bộ r&otilde; chỉ sau một th&aacute;ng h&egrave;. V&agrave; điều nhắc nhớ cả nh&agrave; về m&ugrave;a h&egrave; &yacute; nghĩa đ&oacute; l&agrave; chiếc dĩa bằng gốm c&oacute; vẽ h&igrave;nh ngộ nghĩnh do ch&iacute;nh tay Ho&agrave;ng l&agrave;m ra v&agrave; mang về tặng mẹ... &rsquo;&rsquo;</p>\r\n', 'http://ila.edu.vn/anh-van-he/public/upload/testimonial/1491884287_manh-hoang.jpg', null, '4', '1', '2017-03-31 11:16:41', '2017-04-11 04:18:07');
